    false,nt"url": null,nt"notes": "This program involved a series of one day
    cruises on a commercial trawl and longline vessel.  Cruises were conducted once
    per month from 2001-2005.  The objectives of the cruises were: collect monthly biological
    data on all groundfish observed, examine spatial and temporal distributions.  An
    added feature was the use of commercial vessels operated by experienced commercial
    fishermen.  All cruises were conducted in the Monterey Bay area (California).",nt"license_title":
